function getBody() {
    return (
        <div style={bodyCSS}>
          {getImg()}
          <div style={{margin: '20px'}}>
            <h1>
                Hey there! Welcome to my personal website.
            </h1>
            <p>

            </p>
        </div>
      </div>
    )
}

function getImg() {
    return (
    <img src={pic} className="Profile-pic" alt="profile pic" 
                        width="300px" 
                        height="400px" 
                        style={{margin: "50px"}}></img>
    )
}

const bodyCSS = {
    backgroundColor: "#282c34",
    minHeight: "100vh",
    display: "flex",
    flexDirection: "row",
    alignItems: "center",
    justifyContent: "center",
    fontSize: `calc(10px + 2vmin)`,
    color: "white"
}

export default getBody;
